import React from 'react';



function About() {
  return (
    <div>
      <h1>About</h1>
      <div>
        <p>Contact Number:  +91 9400440686,8086617444</p>
        <p>WhatsApp: +1234567890</p>
        <p>Instagram:@your_instagram_handle</p>
      </div>
    </div>
  );
}

export default About;
